import { BrowserRouter , Routes , Route } from 'react-router-dom' ; 

import Home from './pages/Home' ; 
import Login from './pages/Login' ; 
import Signup from './pages'

import Navbar from './components/Navbar' ;

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Navbar/>
        <div className="pages">
        <Routes>
        
        <Route
        path = '/'
        element = { < Home / > }
        />


        </Routes>
        </div>
      </BrowserRouter>

    </div>
  );
}

export default App;
